import React, { useState } from 'react';
import { useNavigate } from 'react-router-dom';
import { FaBook, FaCalendar, FaChartBar, FaCog, FaSignOutAlt, FaUser, FaChalkboardTeacher, FaUsers, FaClock } from 'react-icons/fa';
import './FacultyDashboard.css';

const FacultyDashboard = () => {
  const navigate = useNavigate();
  const [activeSection, setActiveSection] = useState('overview');

  const handleLogout = () => {
    // Simple logout - just navigate to home
    navigate('/');
  };

  const handleSectionChange = (section) => {
    setActiveSection(section);
  };

  // Mock data
  const stats = [
    { title: 'Teaching Courses', value: '4', change: 'Current Semester', type: 'positive' },
    { title: 'Total Students', value: '156', change: '+12', type: 'positive' },
    { title: 'Office Hours', value: '8', change: 'This Week', type: 'neutral' },
    { title: 'Assignments', value: '23', change: 'Pending: 5', type: 'neutral' }
  ];

  const recentActivities = [
    { id: 1, action: 'Assignment graded', course: 'Data Structures', time: '1 hour ago' },
    { id: 2, action: 'Lecture uploaded', course: 'Database Systems', time: '3 hours ago' },
    { id: 3, action: 'Student consultation', course: 'Web Development', time: '1 day ago' },
    { id: 4, action: 'Course material updated', course: 'Computer Networks', time: '2 days ago' }
  ];

  const upcomingEvents = [
    { id: 1, event: 'Faculty Meeting', course: 'Department', date: '2024-01-15', time: '2:00 PM' },
    { id: 2, event: 'Office Hours', course: 'Student Consultation', date: '2024-01-16', time: '10:00 AM' },
    { id: 3, event: 'Exam Review', course: 'Data Structures', date: '2024-01-17', time: '3:00 PM' }
  ];

  return (
    <div className="faculty-dashboard">
      {/* Sidebar */}
      <aside className="sidebar">
        <div className="sidebar-header">
          <div className="logo">
            <span>TAT</span>
          </div>
          <h3>Faculty Portal</h3>
        </div>

        <nav className="sidebar-nav">
          <button
            className={`nav-item ${activeSection === 'overview' ? 'active' : ''}`}
            onClick={() => handleSectionChange('overview')}
          >
            <FaChartBar />
            <span>Overview</span>
          </button>
          <button
            className={`nav-item ${activeSection === 'courses' ? 'active' : ''}`}
            onClick={() => handleSectionChange('courses')}
          >
            <FaBook />
            <span>My Courses</span>
          </button>
          <button
            className={`nav-item ${activeSection === 'students' ? 'active' : ''}`}
            onClick={() => handleSectionChange('students')}
          >
            <FaUsers />
            <span>Students</span>
          </button>
          <button
            className={`nav-item ${activeSection === 'schedule' ? 'active' : ''}`}
            onClick={() => handleSectionChange('schedule')}
          >
            <FaCalendar />
            <span>Schedule</span>
          </button>
          <button
            className={`nav-item ${activeSection === 'grades' ? 'active' : ''}`}
            onClick={() => handleSectionChange('grades')}
          >
            <FaChalkboardTeacher />
            <span>Grading</span>
          </button>
          <button
            className={`nav-item ${activeSection === 'profile' ? 'active' : ''}`}
            onClick={() => handleSectionChange('profile')}
          >
            <FaUser />
            <span>Profile</span>
          </button>
          <button
            className={`nav-item ${activeSection === 'settings' ? 'active' : ''}`}
            onClick={() => handleSectionChange('settings')}
          >
            <FaCog />
            <span>Settings</span>
          </button>
        </nav>

        <div className="sidebar-footer">
          <button className="logout-btn" onClick={handleLogout}>
            <FaSignOutAlt />
            <span>Logout</span>
          </button>
        </div>
      </aside>

      {/* Main Content */}
      <main className="main-content">
        <div className="dashboard-header">
          <h1>Faculty Dashboard</h1>
          <div className="user-info">
            <div className="user-avatar">F</div>
            <span>Faculty User</span>
          </div>
        </div>

        {activeSection === 'overview' && (
          <>
            {/* Stats Grid */}
            <div className="stats-grid">
              {stats.map((stat, index) => (
                <div key={index} className="stat-card">
                  <h3>{stat.title}</h3>
                  <div className="stat-value">{stat.value}</div>
                  <div className={`stat-change ${stat.type}`}>
                    {stat.change}
                  </div>
                </div>
              ))}
            </div>

            {/* Content Grid */}
            <div className="content-grid">
              {/* Recent Activity */}
              <div className="recent-activity">
                <h2>Recent Activity</h2>
                {recentActivities.map((activity) => (
                  <div key={activity.id} className="activity-item">
                    <div className="activity-icon">
                      <FaChalkboardTeacher />
                    </div>
                    <div className="activity-content">
                      <h4>{activity.action}</h4>
                      <p>{activity.course}</p>
                    </div>
                    <div className="activity-time">{activity.time}</div>
                  </div>
                ))}
              </div>

              {/* Upcoming Events */}
              <div className="upcoming-events">
                <h2>Upcoming Events</h2>
                {upcomingEvents.map((event) => (
                  <div key={event.id} className="event-item">
                    <div className="event-icon">
                      <FaClock />
                    </div>
                    <div className="event-content">
                      <h4>{event.event}</h4>
                      <p>{event.course}</p>
                      <p className="event-time">{event.date} at {event.time}</p>
                    </div>
                  </div>
                ))}
              </div>
            </div>
          </>
        )}

        {activeSection === 'courses' && (
          <div className="section-content">
            <div className="section-header">
              <h2>My Courses</h2>
            </div>
            <div className="no-data">
              <p>Course management section - Coming soon</p>
            </div>
          </div>
        )}

        {activeSection === 'students' && (
          <div className="section-content">
            <div className="section-header">
              <h2>Student Management</h2>
            </div>
            <div className="no-data">
              <p>Student management section - Coming soon</p>
            </div>
          </div>
        )}

        {activeSection === 'schedule' && (
          <div className="section-content">
            <div className="section-header">
              <h2>Teaching Schedule</h2>
            </div>
            <div className="no-data">
              <p>Schedule section - Coming soon</p>
            </div>
          </div>
        )}

        {activeSection === 'grades' && (
          <div className="section-content">
            <div className="section-header">
              <h2>Grading System</h2>
            </div>
            <div className="no-data">
              <p>Grading section - Coming soon</p>
            </div>
          </div>
        )}

        {activeSection === 'profile' && (
          <div className="section-content">
            <div className="section-header">
              <h2>Faculty Profile</h2>
            </div>
            <div className="no-data">
              <p>Profile section - Coming soon</p>
            </div>
          </div>
        )}

        {activeSection === 'settings' && (
          <div className="section-content">
            <div className="section-header">
              <h2>Account Settings</h2>
            </div>
            <div className="no-data">
              <p>Settings section - Coming soon</p>
            </div>
          </div>
        )}
      </main>
    </div>
  );
};

export default FacultyDashboard;
